declare @IdWF varchar(256)
declare @IdTipoDoc numeric(2,0)
declare @NroDoc numeric(11,0)
declare @IdPersona varchar(50)
declare @DesambiguacionCuitPais int
DECLARE db_cursor CURSOR FOR select IdTipoDoc, NroDoc, IdPersona, DesambiguacionCuitPais from Persona where Cuit='27165995703' order by IdTipoDoc, NroDoc, IdPersona, DesambiguacionCuitPais
OPEN db_cursor   
FETCH NEXT FROM db_cursor INTO @IdTipoDoc, @NroDoc, @IdPersona, @DesambiguacionCuitPais
WHILE @@FETCH_STATUS = 0   
BEGIN
	update Configuracion set @IdWF=Valor=convert(varchar(256), convert(int, Valor)+1) where IdItemConfig='UltimoIdWF'
	update Persona set IdWF=@IdWF where Cuit='27165995703' and IdTipoDoc=@IdTipoDoc and NroDoc=@NroDoc and IdPersona=@IdPersona and DesambiguacionCuitPais=@DesambiguacionCuitPais
	insert Log values (@IdWF, getdate(), 'paretto', 'Persona', 'Alta', 'Vigente', 'AUTOM')
	FETCH NEXT FROM db_cursor INTO @IdTipoDoc, @NroDoc, @IdPersona, @DesambiguacionCuitPais
END   
CLOSE db_cursor   
DEALLOCATE db_cursor
go

